import{o as e,c as t,a as s}from"./app.88357bea.js";const a='{"title":"Ressource : Ajout d\'une catégorie","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. Description de la Resource","slug":"_1-description-de-la-resource"},{"level":2,"title":"2. URL et Méthode d\'accès","slug":"_2-url-et-methode-d-acces"},{"level":2,"title":"3. Paramètres","slug":"_3-parametres"},{"level":2,"title":"4. Requête réussie","slug":"_4-requete-reussie"},{"level":2,"title":"5. Cas d\'échec d\'une requête","slug":"_5-cas-d-echec-d-une-requete"}],"relativePath":"guide/services/transactions/category/store.md","lastUpdated":1626178720689}',n={},r=s('<h1 id="ressource-ajout-d-une-categorie"><a class="header-anchor" href="#ressource-ajout-d-une-categorie" aria-hidden="true">#</a> Ressource : Ajout d&#39;une catégorie</h1><hr><h2 id="_1-description-de-la-resource"><a class="header-anchor" href="#_1-description-de-la-resource" aria-hidden="true">#</a> 1. Description de la Resource</h2><p>Cette ressource permet d&#39;enregistrer une catégorie.</p><h2 id="_2-url-et-methode-d-acces"><a class="header-anchor" href="#_2-url-et-methode-d-acces" aria-hidden="true">#</a> 2. URL et Méthode d&#39;accès</h2><p>Pour acceder à cette ressource, vous faites appel à l&#39;url suivante:</p><div class="language-"><pre><code>url: /category\n</code></pre></div><div class="warning custom-block"><p class="custom-block-title">Rappel</p><p>L&#39;accès aux données à cette ressource se fait via la méthode <strong><code>POST</code></strong></p></div><h2 id="_3-parametres"><a class="header-anchor" href="#_3-parametres" aria-hidden="true">#</a> 3. Paramètres</h2><p>Ci-dessous le tableau descriptif des paramètres de cette ressource :</p><table><thead><tr><th>paramètre</th><th style="text-align:center;">Type</th><th>Règle de validation</th><th style="text-align:center;">Description</th></tr></thead><tbody><tr><td>createdAt</td><td style="text-align:center;">datetime</td><td>Obligatoire</td><td style="text-align:center;">Date de création</td></tr><tr><td>slug</td><td style="text-align:center;">string</td><td>Optionnel</td><td style="text-align:center;">créé/généré à partir du nom à afficher (displayname)</td></tr><tr><td>displayName</td><td style="text-align:center;">string</td><td>Obligatoire, min=3, max=200</td><td style="text-align:center;">Nom à afficher</td></tr><tr><td>status</td><td style="text-align:center;">string</td><td>Obligatoire, <br> Valeurs à choisir : <strong>enabled, disabled</strong></td><td style="text-align:center;">le status</td></tr></tbody></table><h2 id="_4-requete-reussie"><a class="header-anchor" href="#_4-requete-reussie" aria-hidden="true">#</a> 4. Requête réussie</h2><p>Lorsque la requête est validée avec succès, il s&#39;affichera un resultat de type suivant:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;display_name&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Vente-de produit --&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;status&quot;</span><span class="token operator">:</span> <span class="token string">&quot;enabled&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;slug&quot;</span><span class="token operator">:</span> <span class="token string">&quot;vente-dun-produit1&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;id&quot;</span><span class="token operator">:</span> <span class="token number">4</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;created_at&quot;</span><span class="token operator">:</span> <span class="token string">&quot;2021-06-28 14:47:51&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="_5-cas-d-echec-d-une-requete"><a class="header-anchor" href="#_5-cas-d-echec-d-une-requete" aria-hidden="true">#</a> 5. Cas d&#39;échec d&#39;une requête</h2><p>En cas d&#39;échec, quand vous renseignez un <strong>slug</strong> dejà utilisé, vous aurez un message de type:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;slug&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Cette valeur est déjà utilisée.&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div>',17);n.render=function(s,a,n,o,d,c){return e(),t("div",null,[r])};export default n;export{a as __pageData};
